import React from 'react';
import Link from 'next/link';

const Navbar = () => (
    <div>
    <ul>
        <li>
            <Link href='/'><a>Inicio</a></Link>
            <Link href='/nosotros'><a>Nosotros</a></Link>
        </li>
    </ul>
</div>
);

export default Navbar;
